import './App.css';
import React from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import "./Home";
import "./DogGallery";
import "./aboutUs";
import Navbar from './Navbar';


function App() {
  return (
    <Router>
    <div className="App">
      <Navbar />
      <br></br>
      <h1>Dogues - dog breed selection</h1>

    </div>
    </Router>
  );
}

export default App;
